import React from 'react';

const Main = () => {
    return (
        <div className="login-container">
            <header className="login-header">
                <h1>Login page</h1>
            </header>
            <main className="login-content">
                <p>실시간 미세먼지 데이터를 분석하여 건강에 미치는 영향을 예측하고, 예방 방법을 제공합니다.</p>
            </main>
        </div>
    );
};


export default Main;
